  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108092 includes chemical,
  discrete sample, physical and profile data collected from PRIDE OF BILBAO in the
  Bay of Biscay, English Channel and North Atlantic Ocean from 2005-09-26 to 2010-09-16
  and retrieved during cruise VOS_Pride_of_Bilbao_2005_2010. These data include DISSOLVED
  INORGANIC CARBON (DIC), DISSOLVED OXYGEN, NITRATE + NITRITE CONTENT (CONCENTRATION),
  PHOSPHATE, SALINITY, SILICATE, TOTAL ALKALINITY (TA) and WATER TEMPERATURE. The
  instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement and bottle. These data were collected by David Hydes and Zongpei
  Jiang of National Oceanography Centre, Southampton as part of the VOS_Pride_of_Bilbao
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
